function log2(x)
    return math.log(x) / math.log(2)
end

function lshift(x, by)  -- bit32 free, Lua 5.2, 5.3 compatible lshift
    if log2(x) + by < 31 then
        return x * 2 ^ by
    else
        return 2147483648 + (x - 2 ^ math.floor(log2(x))) * 2 ^ by
    end
end

function bitand(a, b)
    local result = 0
    local bitval = 1
    while a > 0 and b > 0 do
      if a % 2 == 1 and b % 2 == 1 then -- test the rightmost bits
          result = result + bitval      -- set the current bit
      end
      bitval = bitval * 2 -- shift left
      a = math.floor(a/2) -- shift right
      b = math.floor(b/2)
    end
    return result
end

function bitor(a, b)
    local result = 0
    local bitval = 1
    while a > 0 and b > 0 do
      if a % 2 == 1 or b % 2 == 1 then -- test the rightmost bits
          result = result + bitval      -- set the current bit
      end
      bitval = bitval * 2 -- shift left
      a = math.floor(a/2) -- shift right
      b = math.floor(b/2)
    end
    return result
end

function cp949_to_utf8(s)
    local ret = {}
    local s = s..'\0'
    local i = 1
    function readbyte(s)
        local ret = string.byte(s, i)
        i = i + 1
        return ret
    end
    while true do
        local b1 = readbyte(s, i)
        if b1 == 0 and i >= 4 then break end
        if b1 < 128 then
            ret[#ret+1] = b1
        else
            local b2 = readbyte(s, i+1)
            if b2 == 0 and i >= 4 then break end
