            ret[#ret+1] = SetMemory(dst - dst % 4 +n-1, SetTo, _dw(t, n))
            n = n + 4
        end
    elseif type(string) == "number" then
        ret[#ret+1] = SetMemory(dst - dst % 4, SetTo, string)
    end
    return ret
end

