function GetStrSize(cp949flag,String)
	if type(String) == "number" then
		String = ToString(String)
	end
	local Size = 0
	if cp949flag == "X" or cp949flag == nil or cp949flag == 0 then -- utf8 Size
		String = cp949_to_utf8(String)
		Size = #String-1
	else -- cp949 Size
		Size = #String
	end
	return Size
end

